CREATE TABLE empresa(
	id int not null,
	nombre text
);
CREATE TABLE hospital(
	id int not null,
	nombre text
);
CREATE TABLE equipo(
	id int not null,
	nombre text
);
CREATE TABLE marca(
	id int not null,
	nombre text
);
CREATE TABLE modelo(
	id int not null,
	nombre text
);
CREATE TABLE os(
	id int not null,
	nombre text
);
CREATE TABLE ingeniero(
	id int not null,
	nombre text
);
ALTER TABLE empresa ADD primary key (id);
ALTER TABLE hospital ADD primary key (id);
ALTER TABLE equipo ADD primary key (id);
ALTER TABLE marca ADD primary key (id);
ALTER TABLE modelo ADD primary key (id);
ALTER TABLE os ADD primary key (id);
ALTER TABLE ingeniero ADD primary key (id);
create sequence seq_empresa;
create sequence seq_hospital;
create sequence seq_equipo;
create sequence seq_marca;
create sequence seq_modelo;
create sequence seq_os;
create sequence seq_ingeniero;

CREATE TABLE servicio (
	id int not null,
	fecha_entrega text,
	serie text,
	apertura text,
	fecha_instalacion text,
	garantia text,
	mantenimiento text,
	capacitacion text,
	entrega_equipo text,
	visita text,
	id_empresa int,
	id_hospital int,
	id_equipo int,
	id_marca int,
	id_modelo int,
	id_os int,
	id_ingeniero int,
	foreign key (id_empresa) references empresa(id),
	foreign key (id_hospital) references hospital(id),
	foreign key (id_equipo) references equipo(id),
	foreign key (id_marca) references marca(id),
	foreign key (id_modelo) references modelo(id),
	foreign key (id_os) references os(id),
	foreign key (id_ingeniero) references ingeniero(id)
);

create sequence seq_servicio;














